import React from "react";
import {
  Box,
  Typography,
  IconButton,
  Grid,
  Paper,
} from "@mui/material";
import CloseIcon from "@mui/icons-material/Close";
import BeachAccessIcon from "@mui/icons-material/BeachAccess";
import DirectionsWalkIcon from "@mui/icons-material/DirectionsWalk";
import RestaurantIcon from "@mui/icons-material/Restaurant";
import LocalBarIcon from "@mui/icons-material/LocalBar";
import LocalFloristIcon from "@mui/icons-material/LocalFlorist";
import CameraAltIcon from "@mui/icons-material/CameraAlt";
import MusicNoteIcon from "@mui/icons-material/MusicNote";

const activities = [
  { icon: <BeachAccessIcon />, label: "Plage à San Sebastián" },
  { icon: <DirectionsWalkIcon />, label: "Randonnée dans les Picos de Europa" },
  { icon: <RestaurantIcon />, label: "Tapas à Bilbao" },
  { icon: <LocalBarIcon />, label: "Coucher de soleil avec mojito à Porto" },
  { icon: <LocalFloristIcon />, label: "Jardin botanique de Coimbra" },
  { icon: <CameraAltIcon />, label: "Photos au mirador de Lisbonne" },
  { icon: <MusicNoteIcon />, label: "Soirée Fado au centre historique" },
];

const SearchPage = ({ onClose }) => {
  return (
    <Box
      sx={{
        position: "absolute",
        top: 0,
        right: 0,
        width: "100vw",
        height: "100vh",
        backgroundColor: "background.default",
        padding: 3,
        overflowY: "auto",
      }}
    >
      <IconButton onClick={onClose} sx={{ position: "absolute", top: 20, right: 20 }}>
        <CloseIcon />
      </IconButton>

      <Typography variant="h4" align="center" gutterBottom>
        Activités
      </Typography>

      <Grid container spacing={3} justifyContent="center">
        {activities.map((activity, index) => (
          <Grid item xs={12} sm={6} md={4} key={index}>
            <Paper
              elevation={4}
              sx={{
                padding: 2,
                display: "flex",
                alignItems: "center",
                gap: 2,
                borderRadius: 3,
                transition: "0.3s",
                ":hover": { transform: "scale(1.03)", boxShadow: 6 },
              }}
            >
              <Box sx={{ fontSize: 32 }}>{activity.icon}</Box>
              <Typography variant="subtitle1">{activity.label}</Typography>
            </Paper>
          </Grid>
        ))}
      </Grid>
    </Box>
  );
};

export default SearchPage;
